var colorReverser=function(){var e=document.getElementById("navigation");if(null!==e)var t=new Waypoint.Inview({element:document.getElementById("clipac"),entered:function(t){"down"==t&&(e.classList.add("reverse"),console.log("Entered triggered with direction "+t))},enter:function(t){"up"==t&&(e.classList.add("reverse"),console.log("Enter triggered with direction "+t))},exit:function(t){"up"==t&&(e.classList.remove("reverse"),console.log("Exit triggered with direction "+t))},exited:function(t){"down"==t&&(e.classList.remove("reverse"),console.log("Exited triggered with direction "+t))}})};